import React from "react";
import "./ProfileCard.css";
import ProfilePicture from "../../img/profileImg.jpg";
const ProfileCard = () => {
  return (
    <div className="ProfileCard">
      <img src={ProfilePicture} alt="Profile Picture" />
    </div>
  );
};

export default ProfileCard;
